description:
The Billionaire's Daughter
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Mr. Castle and his wife Patricia are at the head of a true media empire. They succeed at everything they do, they are beautiful, they are in love, they are very rich, they go from one success to another and journalists are at their feet. But there is just one thing: Mr. and Mrs. Castle have a very wild daughter, Lana. A real night owl, Lana spends her evenings doing the rounds of social events, pouncing at will on every guy she meets that she fancies with no-one off limits. But one evening, while having passionate sex with handsome Johnny in the toilets of a disco, Lana is surprised by a paparazzo...

Cast: Anissa Kate, Tiffany Doll, Emma Leigh, Rebecca More, Sienna Day, Lou Lou, Danny D, Ryan Ryder, Mike Angelo, Pascal St. James, Dean Van Damme

